import Link from 'next/link';
import { withRouter } from 'next/router';
import Layout from '../components/Layout';
import fetch from 'isomorphic-unfetch';

const Content = withRouter((props) => {
    return (
        <>
            <h3>My Blog</h3>

            <Link href="/">
                <a className="link">‚Üê Back</a>
            </Link>

            <p className="title">{ props.router.query.title }</p>
            <p className="content">{ props.router.query.content }</p>

            <style jsx>{`
                .title {
                    font-size: 40px;
                    color: #3ea8a3;
                    margin: 0 0 10px 0;
                }
                .content {
                    font-size: 16px;
                    line-height: 1.75em;
                }
                .link {
                    display: block;
                    font-size: 15px;
                }
            `}</style>
        </>
    );
});

const Post = (props) => {
    return (
        <Layout>
            <Content />
        </Layout>
    );
}

export default Post;
